        </div>
        <div id="logP"></div>

        <script>
var QQ = function() {
    return [].reduce.call(arguments, function(ret, i) {
        return function() {
            return ret(i.apply(null, arguments));
        };
    });
};

var BoState = function() {
    var S = {
        t: 0,
        c: 0
    };
    S.setT = function(t) {
        S.t = t;
    };
    S.setC = function(c) {
        S.c = c;
    }
    S.minus = function() {
        --S.c;
    }
    S.add = function() {
        ++S.c;
    }
    S.flag = function() {
        return S.c < S.t;
    };
    S.go = function() {
        BoLogP.reset();
        BoLogP.log(S.c + ' done, ' + (S.t - S.c) + ' left.');
        S.flag() ? setTimeout(function() {
            BoCP.go('https://c.gridsumdissector.com/r/' + RANDOMURL() + '__OS__&if=__IDFA__&oid=__OPENUDID__&aid=__ANDROIDID__&im=__IMEI__&oa=__OAID__&m=__MAC__&ip=__IP__&ts=__TS__&did=__DUID__&aaid=__AAID__&uid=__UDID__&odin=__ODIN__&ua=__UA__&lbs=__LBS__&geo=__GEO__&autorefresh=__AUTOREFRESH__&caid=__CAID__').then(function() {
                S.add();
                S.go();
            });
        }, 1000 + Math.random() * 3000) : S.end();
    };
    S.end = function() {
        BoBtnP.disable();
        BoConP.disable();
    };
    S.start = function() {
        BoBtnP.disable();
        BoConP.disable();
        BoLogP.reset();
        S.setT(BoConP.x);
        S.setC(0);
        S.go();
    };
    return S;
}();

var BoConP = function() {
    var S = {
        conP: document.getElementById('conP'),
        disabled: false,
        x: 10
    };
    S.lessDiv = S.conP.children[0];
    S.infoDiv = S.conP.children[1];
    S.moreDiv = S.conP.children[2];
    S.info = function(x) { S.infoDiv.innerHTML = x; };
    S.less = QQ(S.info, function() {
        return S.x -= S.x > 10 ? 5 : S.x > 1 ? 1 : 0;
    });
    S.more = QQ(S.info, function() {
        return S.x += S.x >= 10 ? 5 : 1;
    });
    S.lessDiv.addEventListener('click', S.less);
    S.moreDiv.addEventListener('click', S.more);
    S.reset = function() { S.info(S.x = 10) };
    S.disable = function() {
    };
    S.info(S.x);
    return S;
}();

var BoLogP = function() {
    var S = {
        logP: document.getElementById('logP'),
        x: ''
    };
    S.log = function(x) {
        S.x += x;
        S.logP.innerHTML = S.x;
    };
    S.reset = function() {
        S.x = '';
        S.logP.innerHTML = S.x;
    };
    return S;
}();

var BoCP = function() {
    var S = {
        cP: document.getElementById('c'),
    };
    var bbresolve;
    S.onload = function() {
        bbresolve && bbresolve('OK');
    };
    S.cP.addEventListener('load', S.onload);
    S.go = function(src) {
        return new Promise(function(resolve) {
            S.cP.src = src;
            bbresolve = resolve;
        });
    };
    return S;
}();


var BoBtnP = function() {
    var S = {
        btnP: document.getElementById('btnP'),
    };
    S.btn = S.btnP.children[0];
    S.disable = function() {
        S.btn.disabled = !S.btn.disabled;
    };
    S.click = function() {
        BoState.start();
    };
    S.btn.addEventListener('click', S.click);
    return S;
}();
